$(document).ready(function(){let sendMapToMobile=function(){let destinations=global_pdf.route_stops;let mobile_start="comgooglemaps://?saddr=My+Location";let mobile_end="";let midpoints="";for(let i=0;i<destinations.length;i++){if(i==destinations.length-1){mobile_end="&daddr="+destinations[i].lat+","+destinations[i].lng+"";}else{midpoints+="+to:"+destinations[i].lat+","+destinations[i].lng+"";}}
let href=mobile_start+mobile_end+midpoints+"&views=traffic";window.open(href);}
$("#mobileFunc").on('click',function(){sendMapToMobile();});});